function ShowOrderLines(n){var t=document.getElementById("ordLineTbl");n.forEach(n=>{var i=t.insertRow(0),r=i.insertCell(0),u=i.insertCell(1),f=i.insertCell(2),e=i.insertCell(3);r.innerHTML=n.id;u.innerHTML=n.itemId;f.innerHTML=n.orderId;e.innerHTML=n.quantity});modal.style.display="block"}var modal=document.getElementById("myModal"),editBtn=document.getElementById("editBtn"),deleteBtn=document.getElementById("deleteBtn"),span=document.getElementsByClassName("close")[0];deleteBtn.onclick=function(){};span.onclick=function(){modal.style.display="none"};window.onclick=function(n){n.target===modal&&(modal.style.display="none")};